E,\n            test_security.FirstName FIRSTNAME,\n            test_security.Address ADDRESS,\n            test_security.City C142,\n            test_security.Phone C143,\n            test_security.Email C144,\n            test_security.Mac MAC,\n            test_security.Ip4 IP4,\n            test_security.Ip6 IP6,\n            test_security.id_card ID_CARD,\n            test_security.bank_card BANK_CARD,\n            test_security.MD_5 MD_5,\n            test_security.MD5 MD5,\n            test_security.SHA1 SHA1,\n            test_security.SHA256 SHA256,\n            test_security.HMACSHA256 HMACSHA256,\n            test_security.number NUMBER    \n        FROM\n            mysql206.zcy_test.test_security) WR_TEST1 \n    INNER JOIN\n        (\n            SELECT\n                sys_user.user_id user_id,\n                sys_user.username username,\n                sys_user.password password,\n                sys_user.salt salt,\n                sys_user.phone phone,\n                sys_user.avatar avatar,\n                sys_user.lock_flag lock_flag,\n                sys_user.login_name login_name,\n                sys_dept.dept_id dept_id,\n                sys_dept.name name,\n                sys_dept.sort sort,\n                sys_dept.create_time create_time,\n                sys_dept.update_time update_time,\n                sys_dept.del_flag del_flag,\n                sys_dept.parent_id parent_id    \n            FROM\n                mysql206.zcy_test.sys_dept    \n            INNER JOIN\n                mysql206.zcy_test.sys_user        \n                    ON sys_dept.dept_id=sys_user.dept_id\n            ) YJL_VIEWTEST_1 \n                ON WR_TEST1.C138=YJL_VIEWTEST_1.dept_id', '0', NULL);
