          mysql206.zcy_test.test_security) WR_TEST1 \n    INNER JOIN\n        (\n            SELECT\n                sys_user.user_id user_id,\n                sys_user.username username,\n                sys_user.password password,\n                sys_user.salt salt,\n                sys_user.phone phone,\n                sys_user.avatar avatar,\n                sys_user.lock_flag lock_flag,\n                sys_user.login_name login_name,\n                sys_dept.dept_id dept_id,\n                sys_dept.name name,\n                sys_dept.sort sort,\n                sys_dept.create_time create_time,\n                sys_dept.update_time update_time,\n                sys_dept.del_flag del_flag,\n                sys_dept.parent_id parent_id    \n            FROM\n                mysql206.zcy_test.sys_dept    \n            INNER JOIN\n                mysql206.zcy_test.sys_user        \n                    ON sys_dept.dept_id=sys_user.dept_id\n            ) YJL_VIEWTEST_1 \n                ON WR_TEST1.C138=YJL_VIEWTEST_1.dept_id \n        WHERE\n            1=1 \n            AND YJL_VIEWTEST_1.dept_id =  \n            AND YJL_VIEWTEST_1.name = \'1\'', '0', '[{\"paramname\":\"dept_id\",\"paramalias\":\"dept_id\",\"paramtype\":\"Integer\",\"operator\":\"\\u003d\",\"paramvalue\":\"\",\"flag\":true},{\"paramname\":\"name\",\"paramalias\":\"部门名称\",\"paramtype\":\"String\",\"operator\":\"\\u003d\",\"paramvalue\":\"1\",\"flag\":true}]');
