-- ----------------------------
-- View structure for view86
-- ----------------------------
DROP VIEW IF EXISTS `view86`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view86` AS select `t_bi_dict_type`.`DICT_ID` AS `DICT_ID`,`t_bi_dict_type`.`DICT_NAME` AS `DICT_NAME`,`t_bi_config`.`CONFIG_KEY` AS `CONFIG_KEY`,`t_bi_dict_data`.`CSS_CLASS` AS `CSS_CLASS` from ((`t_bi_dict_type` join `t_bi_config` on((`t_bi_dict_type`.`CREATE_BY` = `t_bi_config`.`CREATE_BY`))) join `t_bi_dict_data` on((`t_bi_dict_type`.`DICT_TYPE` = `t_bi_dict_data`.`DICT_TYPE`)));

-- ----------------------------
-- View structure for viewtheme
-- ----------------------------
DROP VIEW IF EXISTS `viewtheme`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `viewtheme` AS select `t_bi_role_dept`.`ROLE_ID` AS `ROLE_ID`,`t_bi_role_dept`.`DEPT_ID` AS `DEPT_ID`,`t_bi_dept`.`PARENT_ID` AS `PARENT_ID`,`t_bi_dept`.`ANCESTORS` AS `ANCESTORS` from (`t_bi_dept` join `t_bi_role_dept` on((`t_bi_dept`.`DEPT_ID` = `t_bi_role_dept`.`DEPT_ID`)));

SET FOREIGN_KEY_CHECKS = 1;
